create table SD_instructor
 (instructor_id decimal(8,0) auto_increment = 112 not null comment 'the unique id for an SD_instructor.'
 ,salutation varchar(5) comment 'this SD_instructor''s title (mr., ms., dr., rev., etc.)'
 ,first_name varchar(25)comment 'this SD_instructor''s first name.'
 ,last_name varchar(25) comment 'this SD_instructor''s last name'
 ,street_address varchar(50) comment 'this SD_instructor''s street address.'
 ,zip varchar(5) comment 'the postal zip code for this SD_instructor.'
 ,phone varchar(15) comment 'the phone number for this SD_instructor including area code.'
 ,created_by varchar(30) not null comment 'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(instructor_id)
 ,index (zip)
 ,foreign key (zip)
   references SD_zipcode(zip)
 );

create table SD_grade
 (student_id decimal(8,0) not null comment 'the unique id for the SD_student.'
 ,section_id decimal(8,0) not null comment 'the unique id for a SD_section.'
 ,grade_type_code char(2) not null comment 'the code which identifies a category of SD_grade.'
 ,grade_code_occurrence decimal(38,0) not null comment 'the sequence number of one SD_grade type for one SD_section. for example, there could be multiple assignments numbered 1, 2, 3, etc.'
 ,numeric_grade decimal(3,0) default 0 not null comment 'numeric SD_grade value, (e.g. 70, 75.)'
 ,comments varchar(2000) comment 'SD_instructor''s comments on this SD_grade.'
 ,created_by varchar(30) not null comment 'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(student_id, section_id, grade_type_code ,grade_code_occurrence)
 ,index (section_id, grade_type_code)
 ,foreign key (student_id, section_id)
   references SD_enrollment(student_id, section_id)
 ,foreign key (section_id, grade_type_code)
   references SD_grade_type_weight(section_id, grade_type_code)
 );

create table SD_grade_type
 (grade_type_code char(2) not null comment 'the unique code which identifies a category of SD_grade, i.e. mt, hw.'
 ,description varchar(50) not null comment 'the description for this code, i.e. midterm, homework.'
 ,created_by varchar(30) not null comment 'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(grade_type_code)
 );

alter table SD_grade_type
 add constraint grtyp_grade_type_code_length check (length(grade_type_code)=2)
;

create table SD_grade_conversion
 (letter_grade varchar(2) not null comment 'the unique SD_grade as a letter (a, a-, b, b+, etc.).'
 ,grade_point decimal(3,2) default 0 not null comment 'the number SD_grade on a scale from 0 (f) to 4 (a).'
 ,max_grade decimal(3,0) not null comment 'the highest SD_grade number which makes this letter SD_grade.'
 ,min_grade decimal(3,0) not null comment 'the lowest SD_grade number which makes this letter SD_grade.'
 ,created_by varchar(30) not null comment  'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime  not null comment 'audit column - date of last update.'
 ,primary key(letter_grade)
 );

create table SD_grade_type_weight
 (section_id decimal(8,0) not null comment 'the unique SD_section id for a SD_section.'
 ,grade_type_code char(2) not null comment 'the code which identifies a category of SD_grade.'
 ,number_per_section decimal(3,0) not null comment 'how many of these SD_grade types can be used in this SD_section.  that is, there may be 3 quizzes.'
 ,percent_of_final_grade decimal(3,0) not null comment 'the percentage this category of SD_grade contributes to the final SD_grade.'
 ,drop_lowest char(1) not null comment 'is the lowest SD_grade in this type removed when determining the final SD_grade? (y/n)'
 ,created_by varchar(30) not null comment  'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(section_id ,grade_type_code)
 ,index (grade_type_code)
 ,foreign key (grade_type_code)
   references SD_grade_type(grade_type_code)
 ,foreign key (section_id)
   references SD_section(section_id)
 );

create table SD_section
 (section_id decimal(8,0) auto_increment = 158 not null unique comment 'the unique id for a SD_section.'
 ,course_no decimal(8,0) not null unique comment 'the SD_course number for which this is a SD_section.'
 ,section_no decimal(3,0) not null comment 'the individual SD_section number within this SD_course.'
 ,start_date_time datetime comment 'the date and time on which this SD_section meets.'
 ,location varchar(50) comment 'the meeting room for the SD_section.'
 ,instructor_id decimal(8,0) not null comment 'the id number of the SD_instructor who teaches this SD_section.'
 ,capacity decimal(3,0) comment 'the maximum number of students allowed in this SD_section.'
 ,created_by varchar(30) not null comment  'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(section_id )
 ,index (instructor_id)
 ,index (course_no)
 ,foreign key (instructor_id)
   references SD_instructor(instructor_id)
 ,foreign key (course_no)
   references SD_course(course_no)
 );

create table SD_course
 (course_no decimal(8,0) auto_increment = 452 not null comment 'the unique id for a SD_course.'
 ,description varchar(50) not null comment 'the full name for this SD_course.'
 ,cost decimal(9,2) comment 'the dollar amount charged for SD_enrollment in this SD_course.'
 ,prerequisite decimal(8,0) comment 'the id number of the SD_course which must be taken as a prerequisite to this SD_course.'
 ,created_by varchar(30) not null comment  'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(course_no)
 ,index (prerequisite)
 ,foreign key (prerequisite)
   references SD_course(course_no)
 );

create table SD_enrollment
 (student_id decimal(8,0) not null comment 'the unique id for a SD_student.'
 ,section_id decimal(8,0) not null comment 'the unique id for a SD_section.'
 ,enroll_date datetime not null comment 'the date this SD_student registered for this SD_section.'
 ,final_grade decimal(3,0) comment 'the final SD_grade given to this SD_student for all work in this SD_section (class).'
 ,created_by varchar(30) not null comment  'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(student_id, section_id)
 ,index (section_id)
 ,foreign key (student_id)
   references SD_student(student_id)
 ,foreign key (section_id)
   references SD_section(section_id)
 );

create table SD_student
 (student_id decimal(8,0) auto_increment = 401 not null comment 'the unique id for a SD_student.'
 ,salutation varchar(5) comment 'the SD_student''s title (ms., mr., dr., etc.).'
 ,first_name varchar(25) comment 'this SD_student''s first name.'
 ,last_name varchar(25) not null comment 'this SD_student''s last name.'
 ,street_address varchar(50) comment 'the SD_student''s street address.'
 ,zip varchar(5) not null comment 'the postal zip code for this SD_student.'
 ,phone varchar(15) comment 'the phone number for this SD_student including area code.'
 ,employer varchar(50) comment 'the name of the company where this SD_student is employed.'
 ,registration_date datetime not null comment 'the date this SD_student registered in the program.'
 ,created_by varchar(30) not null comment  'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(student_id)
 ,index (zip)
 ,foreign key (zip)
   references SD_zipcode(zip)
 );

create table SD_zipcode
 (zip varchar(5) not null comment 'the zip code number, unique for a city and state.'
 ,city varchar(25) comment 'the city name for this zip code.'
 ,state varchar(2) comment 'the postal abbreviation for the us state.'
 ,created_by varchar(30) not null comment  'audit column - indicates user who inserted data.'
 ,created_date datetime not null comment 'audit column - indicates date of insert.'
 ,modified_by varchar(30) not null comment 'audit column - indicates who made last update.'
 ,modified_date datetime not null comment 'audit column - date of last update.'
 ,primary key(zip)
 );


